                    type: 'endsWith',
                    filter: 'g',
                },
                {
                    type: 'startsWith',
                    filter: 's',
                },
            ],
            operator: 'AND',
        })
        .then(() => {
            gridApi!.onFilterChanged();
        });
}

function ageBelow25() {
